- input: "TEXT\x1CC00397034\x1CTEXT1\x1C\x1CF3A\x1CThis amendment includes the following
    changes from our original 2007 year end report.  Citi Group/Smith Barney was reported
    with interest payments, these should not have been reported, and those amounts
    were the value of the account, not interest.  The interest is not paid until maturity.
    \ The 12/3/07 $422.00 contribution from Dana Armentor was incorrectly reported
    as a contribution for the 2008 primary, this has been changed to the 2008 General.
    \ The 10/25/07 $1000.00 contribution from Edward D. Markle was incorrectly reported
    as a contribution for the 2008 primary, this has been changed to the 2008 General.
    \ The 12/6/08 $1000.00 contribution from AAJ PAC was incorrectly reported as a
    contribution for the 2008 primary, this has been changed to the 2008 General.
    \ This was the intention of the donor as stated on their check.  The 12/31/07
    $1000.00 contribution from Comcast Corp. PAC was incorrectly reported as a contribution
    for the 2008 primary, this has been changed to the 2008 General.  This was the
    intention of the donor as stated on their check.  These four cases were clerical
    errors and never put any of the donors over the contribution limits of $2300.00
    per election for individuals and $5000.00 per election for PACs.  Line 1 of FEC
    Form 3Z-1 should be correct when the 2006 contributions for the 2008 cycle and
    the unitemized contributions for the 2008 cycle are added.  This matter was resolved
    over the phone by the committee and the FEC analyst for the committee."
